import "./CouponScreen.css";

const CouponScreen=()=>{
return(
<div>

<div class="container">
  <img src="https://i.pinimg.com/originals/d0/77/43/d077434382d46cb6f0bf31a35d5d8965.png" alt="Avatar" width="2vw"></img>
  <h2>Gordon Ramsay</h2>
  <p>Cooks stuff</p>
  <br/>
  <h3>"Best Cheese I've ever had. They deserve a 10/10..."</h3>
</div>

<div class="container2">
  <img src="avatar_g2.jpg" alt="Avatar" width="20vw"></img>
  <p><span >Rebecca Flex.</span> CEO at Company.</p>
  <p>No one is better than John Doe.</p>
</div> 

</div>
)};

export default CouponScreen;
